import React, { useState } from 'react';
import '../css/Admin.css';
import logo from '../img/logo.png';
import { useNavigate } from 'react-router-dom';

function Admin() {
  const navigate = useNavigate();

  const [selectedRow, setSelectedRow] = useState(null);

  const handleRowClick = (index) => {
    setSelectedRow(index);
  };
  
  const rows = [
    { tipo: 'PR - Curitiba', bairro: 'Uberaba', usuario: 'Casa', email: 'R$800.00' },
    { tipo: 'PR - Curitiba', bairro: 'Prado Velho', usuario: 'Apto.', email: 'R$1200.00' },
    { tipo: '', bairro: '', usuario: '', email: '' },
    { tipo: '', bairro: '', usuario: '', email: '' },
  ];

  return (
    <div className="Admin">
      <header className="Admin-header">
        <table>
          <tbody>
            <tr>
              <td colSpan="2">
                <img src={logo} className="rentfyLogoAdmin" alt="logo" />
              </td>
            </tr>
            <tr>
              <td>
                <fieldset className="fieldset-custom">
                  <legend>Painel de Administração</legend>
                    <div className="form-group">
                      <label htmlFor="dataInicio">Lista de Usuários</label>
                      <br />
                      <table id="imoveis-localizados" className="table-bordered" style={{ fontSize: '16px' }}>
                      <thead>
                        <tr>
                          <th>UF - Cidade</th>
                          <th>Bairro</th>
                          <th>Tipo</th>
                          <th>Valor</th>
                        </tr>
                      </thead>
                      <tbody>
                        {rows.map((row, index) => (
                          <tr
                            key={index}
                            onClick={() => handleRowClick(index)}
                            style={{ backgroundColor: selectedRow === index ? 'lightblue' : '' }}
                          >
                            <td>{row.ufCidade}</td>
                            <td>{row.bairro}</td>
                            <td>{row.tipo}</td>
                            <td>{row.valor}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                    </div>
                </fieldset>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default Admin;
